a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%E7%99%BD%E7%9F%B3%E5%92%8C%E5%BC%A5--------/" target="_blank">白石和弥</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/11/" target="_blank">剧情片</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E6%97%A5%E6%9C%AC-----------/" target="_blank">日本</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2016/" target="_blank">2016</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.08.10</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>大学时代学习柔道的诸星要一（绫野刚 饰），凭借特长而被借调到北海道担任刑警没有比赛的日子里，他终日负责无聊杂务，满腔的正义之情无处释放。在警署金牌刑警村井（皮埃尔泷 饰）的点拨下，一直以来非黑即白的诸星茅塞顿开，他大肆发展线人，狂刷积分，于是成为北海道道警中的得力干将。他与黑道大哥黑岩胜典（中村狮童</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/96052/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/96148/" data-original="http://pic.youku778.com/upload/vod/2019-08-02/201908021564703726.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">1.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center">BD高清</span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/96148/">日本旅馆的按摩师</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span>未知</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span>未知</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/20/" target="_blank">福利</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E6%97%A5%E6%9C%AC-----------/" target="_blank">日本</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span>未知</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.08.02</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>第1集：只有sewotji夫妇计划旅行，与朋友的妻子一趟勉强他做jujil和丈夫一起藤川。朋友的旅游夫妇在酒店房间出去独自离开后，她呼吁取消按摩中田英寿疲劳游泳池总统酒店房间堆放在旅途签署。她和丈夫是如此孤独，以至于她很孤单，她非常感谢Nakata的触动。中田注意到她的心脏已经回应了她的性感区和按摩</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/96148/">查看详情</a></dd></dl><div class="fed-page-info fed-text-center"><a class="fed-btns-info fed-rims-info fed-hide fed-show-xs-inline fed-btns-disad" href="/s/%E6%97%A5%E6%9C%AC------------/">首页</a><a class="fed-btns-info fed-rims-info fed-btns-disad" href="/s/%E6%97%A5%E6%9C%AC------------/">上页</a><a class="fed-btns-info fed-rims-info fed-hide fed-show-sm-inline fed-btns-green" href="javascript:;">1</a><a class="fed-btns-info fed-rims-info fed-hide fed-show-sm-inline" href="/s/%E6%97%A5%E6%9C%AC----------2---/">2</a><a class="fed-btns-info fed-rims-info fed-hide fed-show-sm-inline" href="/s/%E6%97%A5%E6%9C%AC----------3---/">3</a><a class="fed-btns-info fed-rims-info fed-hide fed-show-sm-inline fed-btns-disad" href="javascript:;">...</a><a class="fed-btns-info fed-rims-info fed-hide fed-show-sm-inline" href="/s/%E6%97%A5%E6%9C%AC----------62---/">62</a><a class="fed-btns-info fed-rims-info fed-hide fed-show-xs-inline" href=